import React from 'react'
import FilterLink from '../container/FilterLink'

const Footer = () => (
  <p>
    Show:
    {" "}
    <FilterLink filter="SHOW_ALL">
      All
    </FilterLink>
    {" "}
    <FilterLink filter="SHOW_ACTIVE">Active</FilterLink>
    {" "}
    <Link>Completed</Link>
  </p>
)

export default Footer
